import React from 'react';
import { Link } from 'react-router-dom';
import './NavigationMenu.css';
import logo from '../assets/idea-ascend-logo.svg';

const NavigationMenu = () => {
  return (
    <nav className="navigation-menu">
      <div className="nav-container">
        <div className="brand-logo">
          <img src={logo} alt="Idea Ascend Logo" />
          <span>Idea Ascend</span>
        </div>

        <div className="nav-links">
          <Link to="/" className="nav-link active">Home</Link>
          <Link to="/about" className="nav-link">About Us</Link>
          <a href="#" className="nav-link">Founder's Teams</a>
          <a href="#" className="nav-link">Mentor</a>
          <a href="#" className="nav-link">Investor</a>
        </div>

        <button className="chatbot-button">CHATBOT</button>
      </div>
    </nav>
  );
};

export default NavigationMenu;
